const NFLPlayerTableHeader = ({ nflPlayer }) => {
  return (
    <tr>
      {
        Object.keys(nflPlayer).map((key) => {
          return (
            <th key={key}>
              <h5>{key}</h5>
            </th>
          )
        })
      }
    </tr>
  )
}

export default NFLPlayerTableHeader
